import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import 'src/assets/css/bootstrap.css';
import 'src/assets/css/manual.css';
import '/src/assets/css/animate.css';
import 'src/assets/css/css-fontello/fontello.css';
import 'src/assets/css/css-fontello/fontello-codes.css';
import 'src/assets/css/css-fontello/fontello-embedded.css';
import 'src/assets/css/css-fontello/fontello-ie7.css';
import 'src/assets/css/css-fontello/fontello-ie7-codes';


ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
